import Reac , { useEffect } from "react";
import moment from "moment";
import HistoryBet from "./HistoryBet";

function HistoryList(props) {

    let result = '';
    let result1 = '';
    let result2 = '';
    let result3 = '';
    let result4 = '';
    let result5 = '';
    let round = props.roundno.split("-");
    
    useEffect(() => {
        api_test();
    }, []);
    
    const api_test = () => {
   
        if ( props.result === undefined )
        {
            return;
        }
        else
        {
            if ( props.status == "close" )
            {
                result = "";
            }
            else
            {
                if ( props.result.powerball_odd_even === "ODD" )
                    result1 = "파 홀";
                else
                    result1 = "파 짝";
            
                if ( props.result.powerball_unover === "UNDER" )
                    result2 = "파 언더";
                else
                    result2 = "파 오버"; 
            
                if ( props.result.sum_odd_even === "ODD" )
                    result3 = "일 홀";
                else
                    result3 = "일 짝";
            
                if ( props.result.sum_unover === "UNDER" )
                    result4 = "일 언더";
                else
                    result4 = "일 오버";
            
                if ( props.result.sum_size === "L" )
                    result5 = "일 L";
                else if ( props.result.sum_size === "M" )
                    result5 = "일 M";
                else    
                    result5 = "일 S";
            }
        }
    };
    

    return (
        <>
            <div key={props.roundid}>라운드id {props.roundid} 라운드 {round[1]} 베팅날짜 {props.date}
                <br/>결과 {result} {result1} {result2} {result3} {result4} {result5}
                <br/>총 베팅 {props.betamount} 총 당첨  { props.status == 'close' ? props.winamount : '' }
                <table>
                    <thead>
                        <tr>
                            <td>베팅구역</td>
                            <td>베팅금</td>
                            <td>당첨금</td>
                        </tr>
                    </thead>
                    <tbody>
                    {props.bet.map((array,index) => (
                        <HistoryBet key={index} value={array}></HistoryBet>
                    ))}
                    </tbody>
                </table>
            </div>
        </>
    );
}



export default HistoryList;
